import React, { useEffect, useState } from "react";
import { useCreateBookingMutation } from "../../redux/api/bookingApi";
import { useGetFlightTypesQuery } from "../../redux/api/flightApi";
import { useGetUsersQuery } from "../../redux/api/adminApi";

const AddBookingForm = ({ onClose, refetch }) => {
  const [form, setForm] = useState({
    travelerId: "",
    travelerName: "",
    email: "",
    mobile: "",
    from: "",
    to: "",
    travelDate: "",
    travelTime: "",
    flightType: "",
    remarks: "",
    status: "pending",
  });

  const { data: users } = useGetUsersQuery();
  const { data: flightTypes } = useGetFlightTypesQuery();
  const [createBooking, { isLoading, isSuccess }] = useCreateBookingMutation();

  const handleChange = (e) => {
    const { name, value } = e.target;
    setForm((prev) => ({ ...prev, [name]: value }));

    // Auto fill email/mobile on traveler selection
    if (name === "travelerId") {
      const selected = users.find((u) => u._id === value);
      if (selected) {
        setForm((prev) => ({
          ...prev,
          travelerId: selected._id,
          travelerName: selected.name,
          email: selected.email,
          mobile: selected.mobile,
        }));
      }
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    await createBooking(form).unwrap();
    refetch();
    onClose();
  };

  return (
    <form onSubmit={handleSubmit}>
      <div className="row mb-3">
        <div className="col-md-6">
          <label className="form-label">Traveler</label>
          <select
            className="form-select"
            name="travelerId"
            value={form.travelerId}
            onChange={handleChange}
            required
          >
            <option value="">Select Traveler</option>
            {users?.map((user) => (
              <option key={user._id} value={user._id}>
                {user.name}
              </option>
            ))}
          </select>
        </div>
        <div className="col-md-6">
          <label className="form-label">Flight Type</label>
          <select
            className="form-select"
            name="flightType"
            value={form.flightType}
            onChange={handleChange}
            required
          >
            <option value="">Select Flight Type</option>
            {flightTypes?.map((ft) => (
              <option key={ft._id} value={ft.name}>
                {ft.name}
              </option>
            ))}
          </select>
        </div>
      </div>

      <div className="row mb-3">
        <div className="col-md-6">
          <label className="form-label">From</label>
          <input
            type="text"
            className="form-control"
            name="from"
            value={form.from}
            onChange={handleChange}
            required
          />
        </div>
        <div className="col-md-6">
          <label className="form-label">To</label>
          <input
            type="text"
            className="form-control"
            name="to"
            value={form.to}
            onChange={handleChange}
            required
          />
        </div>
      </div>

      <div className="row mb-3">
        <div className="col-md-6">
          <label className="form-label">Travel Date</label>
          <input
            type="date"
            className="form-control"
            name="travelDate"
            value={form.travelDate}
            onChange={handleChange}
            required
          />
        </div>
        <div className="col-md-6">
          <label className="form-label">Travel Time</label>
          <input
            type="time"
            className="form-control"
            name="travelTime"
            value={form.travelTime}
            onChange={handleChange}
            required
          />
        </div>
      </div>

      <div className="mb-3">
        <label className="form-label">Remarks</label>
        <textarea
          className="form-control"
          rows="3"
          name="remarks"
          value={form.remarks}
          onChange={handleChange}
        ></textarea>
      </div>

      <div className="d-flex justify-content-end">
        <button
          type="button"
          className="btn btn-secondary me-2"
          onClick={onClose}
        >
          Cancel
        </button>
        <button type="submit" className="btn btn-primary" disabled={isLoading}>
          {isLoading ? "Saving..." : "Save Booking"}
        </button>
      </div>
    </form>
  );
};

export default AddBookingForm;
